import { Outlet, Navigate } from "react-router-dom";

const PrivateRoutes = (props) => {
  let token = JSON.parse(localStorage.getItem("userInfo"));

  return token ? (
    <Outlet {...props} />
  ) : (
    <Navigate
      to={{
        pathename: "/login",
      }}
    />
  );
};

export default PrivateRoutes;
